import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import home from './Home';
import restauranteMenu from './RestauranteMenu';


const Stack = createStackNavigator();
export default function HomeStack({ navigation }) {
  let restaurante = '';
  let addCart;
  console.log(navigation.state);
  if ( navigation.state && navigation.state.params) {
    console.log(navigation.state.params)
    restaurante = navigation.state.params.restaurante;
    addCart = navigation.state.params.addCart;
  }
  return (
      <Stack.Navigator initialroute={'Home'}>
        <Stack.Screen name="Home" component={home} />
        <Stack.Screen name="Pratos" component={restauranteMenu} initialParams={{ restaurante, addCart}} />
      </Stack.Navigator>
  );
}
